import React, {memo} from 'react';
import styled from 'styled-components';

const PalksStoryContainer = styled.div`
    display: flex;

    .coffeeStory{
        width:50%;
        height:200px;
        background-color: #00f6;
    }
    .brandStory{
        width:50%;
        background-color: #f605;
    }
`;

const PalksStory = memo(() => {
  return (
    <PalksStoryContainer>
      <div className='coffeeStory'>
        dsf
      </div>
      <div className='brandStory'>
sdf
      </div>
    </PalksStoryContainer>
  );
});

export default PalksStory;
